Western Canada’s largest Halal Food Festival @bchalalfoodfest is here this weekend in Surrey BC at Holland Park. 

This is truly a foodie paradise so come hungry! 🤤

June 20-22, 2025 (Today Saturday June 21st & Sunday June 22nd from 11am to 10pm)
45+ Food/Drink Vendors
50+ Market Vendors
Rides & Entertainment
✨Entry is FREE 

There is so much good food and we loved everything that we tried. The lineups can be long to some so I recommend picking your top 3 and  line up for those stalls first. 

Here are some vendors we tried and really enjoyed: 
@littlelebanoneats | Viral Dubai Chocolate with strawberries 
@karavanmeats | Wagyu Smash Burger & their Korean Meat Skewers 
@paanwaala.ca | Kids lived their Mango Tango drink 
@jerusalemgrillsh | Hubby really enjoyed their lamb shank 
@thelondonfish1972 | really great fish & chips and the Bang Bang Shrimp was bangin 😝
@lapatisserieameliee | Viral Dubai Chocolate I do wish there was more filling but it was 
@thewaffleco.ca | Kids loved their shakes & waffle with ice cream

Okay what are you waiting for? Get your jacket and run!!! 

👉Tag all your foodies! 

I recommend taking transit if you can. We did park in the Central City parking lot but I heard you can get ticketed so park with caution. I recommend finding pay parking for peace of mind. 

